import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';


const SellerNavBar = () => {
    const navigate = useNavigate();
    
  const token =  sessionStorage.getItem('token');
  const userId = sessionStorage.getItem('userId')

    const handleAddItem = () => {

        navigate(`/addItemForm`);
      
      };
      const handleLogOutSlider = () => {       
        // Clear token from session storage
        sessionStorage.removeItem('token');
        sessionStorage.removeItem('adminId')
    
        // Redirect the user to the login page or any other appropriate page
        window.location.href = '/login'; // Redirect to the login page       
  }

  return (
    <nav className="navbar navbar-expand-lg ">
      <div className="container-fluid">
        <div className="collapse navbar-collapse" id="navbarNavDropdown">
          <ul className="navbar-nav">
            <li className="nav-item hover-zoom">
              <a
                className="nav-link active"
                aria-current="page"
                href="#"
              >
                <button
                  type="button"
                  className="btn btn-warning"
                  onClick={handleAddItem}
                  >Add New Item

                </button>

              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="#">
                <button type="button" className="btn btn-warning">
                  <Link
                    to={`/login`}
                    className="text-dark text-light text-decoration-none fs-6 font-weight-bold"
                  >
                    Log In
                  </Link>
                </button>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                Pricing
              </a>
            </li>
          </ul>
        </div>
      </div>
      <div className='d-flex justify-content-end'>
                <button
                  type="button" className="btn btn-warning " onClick={handleLogOutSlider}>  Log out
                </button>      
          </div>
    </nav>
  );
};

export default SellerNavBar;
